import React from "react";
import "./item.css";

const ItemList = ({ name, desc, price }) => {
   return (
      <div className="item_box">
         <div className="d-flex flex-column">
            <strong>{name}</strong>
            <i>{desc}</i>
            <div>${price}</div>
         </div>
         <div>
            <div>
               <strong className="me-2">Amount</strong>
               <input
                  type="number"
                  min="0"
                  max="10"
                  style={{ width: 40 }}
                  defaultValue="0"
               />
            </div>
            <div>
               <button className="btn">+ Add</button>
            </div>
         </div>
         <hr />
      </div>
   );
};

export default ItemList;
